export default function Resume() {
  return (
    <div class="body">
      <header>
      <h1>Resume</h1>
      </header>
      <iframe title="portfolio" src="https://drive.google.com/file/d/1ZWwu-5y8WgYUPILKSTKBDnZuk0HYHXKU/preview?usp=drivesdk" width="100%" height="1000px">
    </iframe>
    </div>
  );
}
